class Fulljobs extends React.Component({state, address}){
 constructor(state,address){
   this.state ={
     state:state,
     address:address
   }

 }
  render(){
    return(
      <div style={{width:"90%", display:"inline-flex"}}>
        <h2>location:{this.state}</h2><br></br>
        <p>Address:{this.props.address}</p>
      </div>
    )
  }


}






