          <p className="pd">Status: Unemployed</p>
          <p className="pd">Phone Number: {""+sessionStorage.getItem("pnumber")}</p>



        </div>
        <div id="data" style={{display:"none"}}></div>



        </div>
        <div id="available_jobs">
        <h3 style={{textAlign:"center"}} id="">Available Jobs Near me</h3>
        {
          this.fulljobsarray.forEach((element=>{
            <Fulljobs state={element.state} />
          }))
        }

        </div>
      </div>
    );
   }
  }



